let payload = msg.payload;

let ChildData = payload["ChildData"];

let VisibilityControl = payload["VisibilityControl"];

let tenantId = "dae2bccbc97737dcedb1ab198d1aa164";
let pier = global.get("pier");

let WharfNums = [];
let datas = [];
ChildData.forEach( item => {
    let WharfNum = item["WharfNum"];
    let CarNum = item["CarNum"]
    let pierObjectId = pier[WharfNum];

    WharfNums.push(WharfNum);
    const data = {
        "topic": "/DFS/" + tenantId + "/" + pierObjectId,
        "7|1": CarNum.length == 11 && /^\d+$/.test(CarNum.slice(-7)) && /[a-z]/ig.test(CarNum.substring(0,3)) ? 1 : 2,
        "2|1": Number(VisibilityControl["9|" + WharfNum]) ^ 1
        // "1:2": item
    };
    datas.push(data);
});

Object.keys(pier).forEach((key)=>{
    if (!WharfNums.includes(key)){
        const data = {
            "topic": "/DFS/" + tenantId + "/" + pier[key],
            "7|1": 0,
            "2|1": 0
        };
        datas.push(data);
    }
})


datas.push({
    "topic": "/DFS/dae2bccbc97737dcedb1ab198d1aa164/fef1bf470faa54fdacf49c8b2c95cdf4",
    "1|2": ChildData
})
msg.payload = datas;
msg.topic = "";
return msg;

