let payload = msg.payload;
let topic = payload["topic"];

let objectId = topic.substring(topic.lastIndexOf("/") + 1);
let dfsKey = "dfs:digital_twin:" + objectId;

let datas = [];
Object.keys(payload).forEach(key => {
    if(key != "topic"){
        const data = [dfsKey, key, JSON.stringify(payload[key])];
        datas.push(data)
    }
})

msg.payload = datas;
return msg;

let payload = msg.payload
let AGV = global.get("AGV");

let tenantId = "dae2bccbc97737dcedb1ab198d1aa164";
let redis = context.global.get("redis");



let datas = [];
Object.keys(payload).forEach((index) => {

    let agv = payload[index];
    // @ts-ignore
    let objectId = AGV[index%2];

    let dfsKey = "dfs:digital_twin:" + objectId;

    redis.hgetall([dfsKey], (err, oldData) => {
        if (err) {
            node.error("Error getting data from Redis: " + err, msg);
            return;
        }
        let data;
        if (Object.keys(oldData).length == 0){
            node.warn(agv["podDir"] == "");
             data = {
                "topic": "/DFS/" + tenantId + "/" + objectId,
                "data|2": 0,
                "data|13": 0,
                "data|14": 0,
                "data|15": Number(agv["posX"]),
                "data|16": Number(agv["posY"]),
                "data|17": 0, 
                "data|18": agv["robotDir"] == "" ? 0 : Number(agv["robotDir"]),
                "data|19": 0,
                "data|id": agv["robotCode"],
                // "agv_info|voltage": agv["voltage"],
                "agv_info|14": Number(agv["forkLiftInfo"]["ctnrType"] == "" ? "0" : agv["forkLiftInfo"]["ctnrType"]),
                "agv_info|targetPos": "",
                "agv_info|status": Number(agv["status"]),
                "agv_info|electricCurrent": String(Number(agv["inputCur"]) - Number(agv["outCur"])),
                "agv_info|16": agv["battery"],
                "agv_info|temperature": agv["temperatureOne"]
            }
            msg.payload = data;
        } 
        else {

            let speed = 0;
            let oldPosX = oldData["data|15"];
            let oldPosY = oldData["data|16"];
            if (oldData["data|15"] != null && oldData["data|16"] != null) {
                speed = Math.sqrt(Math.abs(Number(oldPosX) - Number(agv["posX"])) ^ 2 + Math.abs(Number(oldPosY) - Number(agv["posY"]) ) ^ 2);
                speed = speed / ((Date.parse(new Date()) - Number(msg.ts))/1000);
                // speed = speed / 1000;
            }

            let data = {
                "topic": "/DFS/" + tenantId + "/" + objectId,
                "data|2": speed,
                "data|13": Number(oldPosX),
                "data|14": Number(oldPosY),
                "data|15": Number(agv["posX"]),
                "data|16": Number(agv["posY"]),
                "data|17": oldData["data|18"] == "" ? 0 : Number(oldData["data|18"]),
                "data|18": agv["robotDir"] == "" ? 0 : Number(agv["robotDir"]),
                "data|19": oldData["data|18"] != null ? Math.abs(agv["robotDir"] - oldData["data|18"]) : 0,
                "data|id": agv["robotCode"],
                // "agv_info|voltage": agv["voltage"],
                "agv_info|14": Number(agv["forkLiftInfo"]["ctnrType"] == "" ? "0" : agv["forkLiftInfo"]["ctnrType"]),
                "agv_info|targetPos": "",
                "agv_info|status": Number(agv["status"]),
                "agv_info|electricCurrent": String(Number(agv["inputCur"]) - Number(agv["outCur"])),
                "agv_info|16": agv["battery"],
                "agv_info|temperature": agv["temperatureOne"]
            }
            msg.payload = data;
            msg.topic = "";
        }
        // msg.delay = agv["ts"];
        node.send(msg);
    })
})

return null;

